import styled from 'styled-components/native';

export const Body = styled.View`
    flex: 1;
    background: #8B10AE;
    /* padding-top: 30; */
    align-items: center;
    justify-content: center;
`

export const Main = styled.View`
    flex: 1;
    align-items: center;
    justify-content: space-around;

    width: 100vw;
`

export const Objective = styled.Text`
    font-size: 25;
    color: white;
    padding: 10px;
    font-weight: bold;
    text-align: center;
    height: 70;
  /* z-index:2; */
`

export const Hand = styled.Image`
    width: 200px;
    height: 350px;
    margin-top: 0px;
`

export const TextInput = styled.TextInput`
    width: 200px;
    height:40px;
    float: left;
    text-align: center;
    font-size: 30px;
    line-height: 100px;
    background-color: #eee;
`

export const N1 = styled.Text`
    width: 90px;
    height:100px;
    margin-right:20px;
    text-align: center;
    font-size: 30px;
    line-height: 100px;
    background-color: #eee;
`

export const Button = styled.Button`
    height: 40xp;
`
